import Header from './components/Header';
import PropTypes from 'prop-types';
import Tasks from './components/Tasks';

function App(){
    return(
        <div className='container'>
            <Header title='Task Tracker'/>
            <Tasks />
        </div>
    )
}
Header.defaultProps = {
    title: 'Task Tracker'
}
Header.propTypes = {
    title: PropTypes.string.isRequired
}

export default App;
